ZA KUMAPETO Mgonero wa Ambuye Ndi Mwambo Umene Umalemekeza Mulungu AKRISTU amalamulidwa kuchita mwambo wa Chikumbutso cha imfa ya Kristu. Mwambo umenewu umatchedwanso “mgonero wa Ambuye.” (1 Akorinto 11:20) Kodi tanthauzo la mwambo umenewu n’chiyani? Kodi uyenera kuchitika liti ndiponso motani? Yesu Kristu anayambitsa mwambo umenewu m’chaka cha 33 C.E. Nthawi yake inali usiku, ndipo tsiku lake linali limene Ayuda anali kuchita mwambo wawo wa Paskha. Paskha unali mwambo umene unali kuchitika kamo
..........
chinthu chooneka. Choncho, mkate komanso vinyo ndi zizindikiro chabe. Mkate umaimira thupi langwiro la Kristu. Yesu anagwiritsa ntchito mkate umene unatsala pa chakudya cha Paskha. Mkatewo anaupanga wopanda chotupitsa, kapena kuti yisiti aliyense. (Eksodo 12:8) Baibulo limagwiritsa ntchito mawu akuti chotupitsa monga chizindikiro cha uchimo kapena kuipa kwa chinthu. Motero mkatewo ukuimira thupi langwiro limene Yesu anapereka nsembe. Linalibe uchimo uliwonse.—Mateyu 16:11, 12; 1 Akorinto 5:6, 7;
